<template>
  <div class="home" style="height : 200vh">
    <div class="row col-md-6 mx-auto">
      <div class="col col-md-2 d-flex flex-column align-item-right">
        <input type="color" v-model="color" />
        <button @click="easter1">easter</button>
        <button class="clear" @click="clearCanvas">clear</button>
        <button class="eraser" @click="useEraser = !useEraser">
          {{ !useEraser ? 'eraser' : 'pencil' }}
        </button>
        <!-- <button @click="sendCanvasData">save</button><br /><br /> -->
      </div>
      <div class="col col-md-10">
        <div @mouseup="sendCanvasData">
          <paintable
          alwaysOnTop
          :active="isActive"
          :width="800"
          :height="800"
          :disableNavigation="disableNavigation"
          :hide="hidePaintable"
          :horizontalNavigation="false"
          :name="isFirstPaintable ? 'myscreen' : 'mysecondscreen'"
          :factor="1"
          :lineWidth="dynamicLineWidth"
          :lineWidthEraser="15"
          :useEraser="useEraser"
          :color="color"
          class="paint"
          ref="paintable"
          @toggle-paintable="toggledPaintable"
          >
          Make Your Drawing Here
          </paintable>
        </div>
      </div>
    </div>
  </div>
</template>

<script>
import socket from '../config/socket'

export default {
  name: 'canvasPaintable',
  components: {
  },
  data () {
    return {
      isActive: true,
      disableNavigation: true,
      hidePaintable: false,
      useEraser: false,
      color: '#999999',
      isFirstPaintable: true,
      dynamicLineWidth: 4
    }
  },
  methods: {
    toggledPaintable (isActive) {
      this.isActive = isActive
    },
    clearCanvas () {
      this.$refs.paintable.clearCanvas()
      this.sendCanvasData()
    },
    sendCanvasData () {
      this.$refs.paintable.saveCurrentCanvasToStorage()
      socket.emit('sendPaintableData', localStorage.myscreen)
    },
    easter1 () {
      const data = 'data:image/png;base64,'
      socket.emit('sendPaintableData', data)
    }
  },
  created () {
  }
}
</script>

